const ADD_MESSAGE = 'ADD-MESSAGE';
const UPDATE_NEW_MESSAGE = 'UPDATE-NEW-MESSAGE'

const initialDialogs = {
    dialogs: [
        {id: 1, name: 'Ilya', img: 'https://www.blast.hk/attachments/64805/'},
        {
            id: 2,
            name: 'Ksu',
            img: 'data:image/jpeg;base64,'
        },
        {
            id: 3,
            name: 'Sergo',
            img: 'data:image/jpeg;base64,'
        },
        {
            id: 4,
            name: 'Misha',
            img: 'data:image/jpeg;base64,'
        },
        {id: 5, name: 'Vanya', img: 'https://trikky.ru/wp-content/blogs.dir/1/files/2020/07/30/original.jpg'},
    ],
    messages: [
        {message: 'Hi!', id: 1},
        {message: 'How are you?', id: 2},
        {message: 'React - super!', id: 3},
    ],
    newMessageText: ''
}

const dialogsReducer = (state = initialDialogs, action) => {

    switch (action.type) {
        case 'ADD-MESSAGE':
            const newMessage = {
                message: state.newMessageText,
                id: 3,
            }
            state.messages.push(newMessage);
            state.newMessageText = '';
            return state;
        case 'UPDATE-NEW-MESSAGE':
            state.newMessageText = action.newText;
            return state;
        default:
            return state;
    }
}

export const addMessageActionCreator = () => ( {type: ADD_MESSAGE} );
export const updateNewMessageActionCreator = (text) => ( { type: UPDATE_NEW_MESSAGE, newText: text } );

export default dialogsReducer;